column8:
@Eduardo Jose Dos Santos 1 (P) / @SC - CSA - Atendimento YMF, boa tarde!

Poderiam ajustar a opção de ordenar (ao clicar no cabeçalho de alguma coluna) as informações em ordem alfabética (para texto) ou do menor para o maior (para número) da tela de Consulta e Edição do CDA do SAC base Asset, por gentileza? Pois esse processo está funcionando para algumas colunas, mas para outras não ocorre, como por exemplo a coluna <COD_ATIV>, utilizada para identificar os ativos para o processo de ocultação.

Se possível, aplicar esse ajuste para todas as colunas de todos os blocos do CDA.

