column9:
Após analise , verificamos que o valor que foi gerado para a zeragem, estava errado.
Pelo que entendemos, o lançamento do resgate foi feito antes da apuração da cota.
Isso gerou um regate errado.
O zeramento é realizado no fechamento. Mesmo processando a abertura ele não muda.
Caso a cota não esteja liberada, ele muda a cada processamento.

O que fizemos?
Limpamos o regate no cotas-cotas;
Excluimos o movimento de regate por quantidade;
Processamos a ABERTURA;
Processamos o FECHAMENTO;
Travamos a cota;
Refizemos o lançamento de resgate por quantidade;
ProcessaMos novamente o fechamento.

Assim, ajustamos a posição de quantidade de cotas.

Orientação encaminhada ao usuário

