column9:
Identificado que apesar da carteira informar início de vigência em 28/02. Somente teve aporete em 05/03, bem como as movimentações de RV nesta mesma data. Conversando com o Antonio Eduardo, responsável pelo processamento da ASSET, ele acertou o cadastro, pois a carteira começou o início em 05/03/24. Fiz o scriipt para a exclusão de registros na tabela SAC_CL_PATRSINT com data inferior à data de inicio, ou seja, inferior à 05/03/2024. E, sobre o sistema não calcular os custos, isso ocorreu por erro cadastral, no cadastro da Carteira estava para considerar a Bolsa do Rio de Janeiro, que aliás nem opera mais. Alterando para Bolsa (São Paulo) o sistema montou as posições corretamente.

SELECT * FROM SAC_CL_PATRSINT
WHERE CLCLI_CD = '4480';

DELETE FROM SAC_CL_PATRSINT
 WHERE CLCLI_CD = '4480'
   AND DT < '05/MAR/2024' ;

